import { StyleSheet } from "react-native";
import React from "react";
const css = StyleSheet.create({
    titulo:{
      color:'#ffffff',
      fontSize: 40,
      textAlign : 'center'
    },
    fundo: {
      flex: 1,
      backgroundColor: '#2e2e2e',
      justifyContent: 'center',
      alignItems: 'center'
    },

    container1:{
      flex:1,
      //backgroundColor: '  ',
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center'
    },
    button1:{
      backgroundColor:'#084d6e',
      marginRight: 50,
      padding: 30,
      color: '#ffffff'
    },
    button2:{
      backgroundColor:'#084d6e',
      marginLeft: 50,
      padding: 30,
      color: '#ffffff'
    },
    dark_bg:{
      backgroundColor:'#333'
    },
    login__msg:{
      fontWeight: "bold",
      fontSize: 22,
      color:'red',
      marginTop:10,
      marginBottom:15,
    },
    login_form:{
      width:'80%',
      marginTop: 10,
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center'
    },
    login_input:{
      backgroundColor: '#fff',
      height:50,
      width:100,
      fontSize: 19,
      padding: 7,
      marginLeft: 10,
    },
    login_button:{
      padding: 12,
      backgroundColor:'#f58634',
      alignSelf: 'center',
      borderRadius: 5
    },
    login_buttonText:{
      fontWeight: 'bold',
      fontSize: 22,
      color: '#333',
    },
  });
  export {css};
